import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { GlobalStyles } from './global-styles';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
    <>
    <GlobalStyles />
    <App />
    </>,
  document.getElementById('root')
);

serviceWorker.unregister();
